Step-by-step reasoning:
1. In the Fehr–Schmidt framework, individuals derive utility from their monetary payoff adjusted by a penalty for inequality. For a responder in the ultimatum game, fairness considerations arise from the difference between the share for the responder (split_self) and the proposer (split_opp).
2. Typically, the full Fehr–Schmidt model includes separate parameters for disadvantageous (envy) and advantageous (guilt) inequality aversion. However, since the dataset always presents split_self > split_opp, the responder never experiences being disadvantaged. Instead, the “fairness cost” is due to receiving more than the opponent, which, counterintuitively, can be interpreted as a dislike for advantageous inequality.
3. In this simplified model, the utility for accepting an offer is the responder’s monetary payoff (split_self) reduced by a fairness cost proportional to the surplus amount over the proposer’s share (split_self – split_opp). A single learnable parameter (beta) captures the degree of aversion to this advantageous inequality.
4. Mathematically, the utility of accepting (U) is given by:
  U = split_self – beta × (split_self – split_opp)
5. This formulation uses only the dataset variables split_self and split_opp and restricts the model to responder behavior. The parameter beta is given generous finite bounds.

Following is the formal specification:

<MODEL>
U = split_self - beta*(split_self - split_opp)
</MODEL>

